import Link from 'next/link';
import React from 'react';
import Axios from 'axios';
import { makeStyles } from '@material-ui/core/styles';
import TextField from '@material-ui/core/TextField';
import Button from '@material-ui/core/Button';
import FormControl from '@material-ui/core/FormControl';
import InputLabel from '@material-ui/core/InputLabel';
import Select from '@material-ui/core/Select';
import MenuItem from '@material-ui/core/MenuItem';

const useStyles = makeStyles(theme => ({
    root: {
        '& > *': {
            margin: theme.spacing(1),
            width: 200,
        },
    },
}));

export default function Home() {

    const classes = useStyles();

    const [openGender, setOpenGender] = React.useState(false);
    
    const handleClose = () => {
        setOpenGender(false);
    };

    const handleOpen = () => {
        setOpenGender(true);
    };
    
    const [_gender, _setGender] = React.useState('')

    const [userID, setUserID] = React.useState(0)
    const [time, setTime] = React.useState('')
    const [bookingDate, setBookingDate] = React.useState('')
    const [paymentType, setPaymentType] = React.useState('')
    const [replicate, setReplicate] = React.useState('')

    const addpost = () => {

        const ApiUrl = 'https://mytown-app.com/api/cleaning_test'

        const data = new FormData()
        data.append('userID', userID)
        data.append('time', time)
        data.append('bookingDate', bookingDate)
        data.append('payment_type', paymentType)
        data.append('replicate', replicate)

        const header = {
            headers: {
                'content-type': 'multipart/form-data'
            }
        }

        Axios.post(ApiUrl, data, header)
            .then(res => {
                console.log(res)
                alert(res);
            })
            .catch(err => {
                console.log(err)
                alert(err);
            })
    }

    return (
        <React.Fragment>

            <h1>Add 2x 4x to book cleaning</h1>

            <form className={classes.root} noValidate autoComplete="off">

                <h4>User ID</h4>
                <TextField
                    id="filled-basic"
                    fullWidth
                    label="User ID"
                    type="number"
                    variant="filled"
                    onChange={(event) => setUserID(event.target.value)}
                />
                <br /><br />
                
                <h4>Time</h4>
                <TextField
                    id="filled-basic"
                    fullWidth
                    label="Time"
                    variant="filled"
                    onChange={(event) => setTime(event.target.value)}
                />

                <FormControl className={classes.formControl}>
                    <InputLabel id="demo-controlled-open-select-label">Gender</InputLabel>
                    <Select
                    labelId="demo-controlled-open-select-label"
                    id="demo-controlled-open-select"
                    open={openGender}
                    onClose={handleClose}
                    onOpen={handleOpen}
                    value={_gender}
                    onChange={event => _setGender(event.target.value)}
                    >
                    <MenuItem value="">
                        <em>None</em>
                    </MenuItem>
                    <MenuItem value={'male'}>Male</MenuItem>
                    <MenuItem value={'female'}>Female</MenuItem>
                    </Select>
                </FormControl>

                <br /><br />
                
                <h4>Booking Date</h4>
                <TextField
                    id="filled-basic"
                    fullWidth
                    type="date"
                    variant="filled"
                    onChange={(event) => setBookingDate(event.target.value)}
                />
                <br /><br />
                
                <h4>Payment Type</h4>
                <TextField
                    id="filled-basic"
                    fullWidth
                    label="Payment Type"
                    variant="filled"
                    onChange={(event) => setPaymentType(event.target.value)}
                />
                <br /><br />
                
                <h4>Schedule Replicates</h4>
                <TextField
                    id="filled-basic"
                    fullWidth
                    label="Schedule Replicates"
                    helperText="2x 4x scheduling per month"
                    variant="filled"
                    onChange={(event) => setReplicate(event.target.value)}
                />
                <br /><br />

                <Link href="/">
                    <Button variant="contained" color="primary" onClick={() => addpost()}>
                        Book to Cleaning Calendar
                    </Button>
                </Link>
            </form>



        </React.Fragment>
    )
}
